import { hasPointerEvents } from "@testing-library/user-event/dist/utils";

const App = () => {
  const categories = [{ id: 1, title: "Hat" }];

  return (
    <div>
      {categories.map((title) => {
        return <h1>{title}</h1>;
      })}
    </div>
  );
};

export default App;
